INSERT INTO `single_question` VALUES ('120025', null, '2020-02-16 00:00:00', null, null, '如果G (x）为11010010，以下4个CRC校验比特序列中只有哪个可能是正确的 ？', '1101011001', '101011011', '11011011', '1011001', 'B', null, '2', '1');
